The myth: Farmers don’t care for the environment and do whatever they can to make a quick buck.

The truth: Farming isn’t just a job, it’s a way of life and something we want to preserve for generations to come.  Farmers know that in order to be successful they need to produce more while using less land and fewer resources. 

Producers are always looking for ways to improve, especially when it comes to the environment.

We use #propane, a reliable and environmentally friendly energy source on our farm to heat our buildings and provide hot water for the dairy operation. I am excited to #partner with the Propane Education & Research Council (PERC) @propane_council and be a part of the Ag Influencer Exchange conversation at the Farm Progress Show. 

PERC + Sukup have put together an amazing panel, including:
@sharkeyfarms 
@nataliekovarik 
@taravanderdussen 
@modfarmchick 
@farm4profit 
@thislldofarm 

The event will bring together industry experts and thought leaders to share insights, discuss sustainable and economical farming practices, and explore the pivotal role of propane-powered farm equipment for cutting costs and improving efficiency.

When: Wednesday, August 30 from 10-11:30 a.m.
Where: Farm Progress Show, Sukup Booth (16W)

Find more information at propane.com/FarmProgress

Will you join the conversation? How do you use propane on your operation?

If I say propane, what comes to mind? I bet propane isn’t something you think about very often, but you probably should. #sponsored. 

Last week I headed to the @farmprogress show to talk with the @propane_council and other producers in the Ag industry. I learned SO much! (And think about Hank Hill totally differently now!)

Propane is
➡️ affordable
➡️ versatile
➡️ reliable 

From heating barns to hot water to running games in dryers, there isn’t a job #propane can’t do. Probably why so many farmers use it. If you want to learn more about propane and it’s many uses and benefits, head to propane.com. 

