Did I really just do this again?

A little over a year ago, I hosted Farm + Grow the Mastermind for the first time. I recall thinking, “nobody is going to come, this will be a disaster”. But that event sold out. 

The I did it again. And again; each time thinking “no one is going to come.  No one cares about this”. That imposter syndrome is a real son of a bitch. 

I may get scared, but each mastermind shows me just how much rural women need this sort of thing. How much we need community, time for ourselves and the opportunity to be who and what we want. 

Women cried, laughed, probably over-shared and ate too much, but I think it’s exactly what they needed. I think everyone left feeling inspired, connected and ready to be better. It was a blast. 

So yes, we will be doing it again next year. 🫶🏻

